import React, { PureComponent } from 'react'
import Navigation from '../Navigation/Navigation'
export default class FrontPage extends PureComponent {
    render() {
        return (
            <div>
                <Navigation/>
                <div style={{width:"40vw", height:"100vh", float:"right",backgroundColor:"red"}}/>
                <div style={{width:"59vw", height:"100vh", backgroundColor:"yellow"}}/>
            </div>
        )
    }
}
